import styled from 'styled-components';

export const Main = styled.main`{  
    padding-top: 10vh;
    max-height: 100vw;
    scroll-snap-type: y mandatory;  
    background-color: var(--black);
    color: var(--grayLight);
    overflow-y: scroll;
}
`;
